import React from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
  return (

<Navbar bg="dark" variant="dark">
<Navbar.Brand href="#home">
<Link className="text-white text-lg brand-text navbar-brand" to="/">
            <img src="https://lajoyalink.com/wp-content/uploads/2018/03/Movie.jpg" height="130" class="d-inline-block align-top  border border-white rounded "/> 
            </Link>
</Navbar.Brand>
<Form inline>
  <Link href="#home">Home</Link>
  <Link href="#features">Features</Link>
  <Link href="#pricing">Pricing</Link>
  </Form>
  <Form inline>
    <Link href="#"><span class="glyphicon glyphicon-user"></span>Features</Link>
      <Link href="#"><span class="glyphicon glyphicon-log-in"></span>Pricing</Link>
    </Form>
    </Navbar>

  );
}




export default Navbar;
